  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Okefenokee NWR
  outlines Refuge accomplishments from February through April of 1941. The report
  begins by summarizing the weather conditions and water conditions during this period.
  Wildlife- including migratory birds and mammals- is also covered. The Refuge development
  and maintenance section discusses physical developments and wildfires. The public
  relations section of the report describes recreational uses and violations. Photographs
  are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
